const Navbar = () => {
    return ( 
        <div className="navbar">
           <h1>My Blog</h1>
           <div className="links">
               <a href="/" className="href">Home</a>
               <a href="/create" className="href">new Blog</a>
           </div>
        </div>
     );
}
 
export default Navbar;
